import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import {connect} from 'react-redux';
import graphic from './img/graphic.png';
import Typography from '@material-ui/core/Typography'
import logo from './img/logo.png';
import TextField from '@material-ui/core/TextField';
import {inviteCodeCheck} from './../../actions/user.actions';
import {getGood} from './../../reducers/user.reducer';

class WelcomePage extends Component {
  constructor(props){
    super(props);
    this.state={
      code:"",
      truth: JSON.parse(sessionStorage.getItem('alpha')),
    }
    this.handleChangeCode=this.handleChangeCode.bind(this);
    this.submit=this.submit.bind(this);
  }

  handleChangeCode(e){
    this.setState({code:e.target.value});
  }

  submit(){
    this.props.dispatch(inviteCodeCheck({invite:this.state.code}));
  }

  handleKeyPress(e){
    if(e.key === 'Enter'){
      this.submit();
    }
  }

  render() {
    return (
      <div className="WelcomePage">
        <Typography className="Header" variant="caption">Welcome to</Typography>
        <img className="WelcomeLogo" src={logo} alt="source"/>
        <Typography className="Tagline" variant="body1">For ideas, projects, and people</Typography>
        {(!this.props.good && !this.state.truth) && (
          <div className="CodeInput">
            <TextField
              id="code-input"
              label="Invite Code"
              value={this.state.code}
              onChange={this.handleChangeCode}
              onKeyPress={(e)=>{this.handleKeyPress(e)}}
              margin="normal"
            />
            <Button className="CodeButton" onClick={this.submit} variant="raised" color="primary">Submit</Button>
          </div>
        )}
        {(this.props.good || this.state.truth) && (
          <a href="/explore/projects" className="ExploreButton"><Button variant="raised" color="primary">Explore</Button></a>
        )}
        <img className="Graphic" src={graphic} alt="graphic"/>
      </div>
    );
  }
}
const mapStateToProps=(state)=>{
  return{
    good: getGood(state)
  }
}
export default connect(mapStateToProps)(WelcomePage);


